
function gaussian_function(x, y, omega, a, b) {
    return 1 / (Math.PI * (2 * omega**2)) * Math.exp(-((x - a) ** 2 + (y - b) ** 2) / (2 * omega**2));
    // return 1 / (Math.PI * (2 * omega**2))
}

function get_gauss_matrix(kernel_size, standard_deviation) {
    let a = Math.floor((kernel_size + 1) / 2) 
    let b = a
    let gauss_matrix = []
    for (let i = 0; i < kernel_size; i++) {
        gauss_matrix[i] = []
        for (let j = 0; j < kernel_size; j++) {
            gauss_matrix[i][j] = gaussian_function(i, j, standard_deviation, a, b)
          }
      }
    return gauss_matrix
}

function get_normalized_matrix(matrix){
    let sum_of_elements = 0
    for (let row = 0; row < matrix.length; row++) {
        sum_of_elements += matrix[row].reduce((acc, val) => acc + val, 0);
    }
    for (let i = 0; i < matrix.length; i++) {
        for (let j = 0; j < matrix.length; j++) {
            matrix[i][j] = matrix[i][j] / sum_of_elements
          }
      }
    return matrix
}

function gauss_blur(img, kernel_size, standard_deviation) {
    // let kernel2 = Array.from({ length: kernel_size }, (v, i) => {
    //     return Array.from({ length: kernel_size }, v => {
    //       return 1;
    //     });
    //   });
    let kernel = get_normalized_matrix(get_gauss_matrix(kernel_size, standard_deviation)) 
    let x_start = Math.floor((kernel_size) / 2) 
    let y_start = Math.floor((kernel_size) / 2)
    let copy_image = img
    let rows_count = img.length
    let columns_count = img[0].length
    for (let i = x_start; i < rows_count - x_start; i++) {
        for (let j = y_start; j < columns_count - y_start; j++) {
            let val = 0
            for (let k = -Math.floor((kernel_size) / 2); k < Math.floor((kernel_size) / 2) + 1; k++ ) {
                for (let l = -Math.floor((kernel_size) / 2); l < Math.floor((kernel_size) / 2) + 1; l++ ) {
                    val += img[i + k][j + l] * kernel[k + (Math.floor((kernel_size) / 2))][l + (Math.floor((kernel_size) / 2))]
                }
            }
            copy_image[i][j] = val
        }
    }
    return copy_image
}

